import React    from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter,
         Route } from 'react-router-dom';

import * as serviceWorker from './serviceWorker';

import './assets/css/fonts.css';
import './assets/css/style.css';

import './assets/fonts/icomoon/style.css';

import Home             from './screens/Home';
import About            from './screens/About';
import Carrers          from './screens/Carrers';
import Contact          from './screens/Contact';
import FAQ              from './screens/FAQ';
import TermsOfPrivacy   from './screens/TermsOfPrivacy';
import TermsOfUse       from './screens/TermsOfUse';
import Services         from './screens/Services';
import BotStatus        from './screens/BotStatus';

ReactDOM.render(
  <BrowserRouter>
    <Route path="/"               exact={true} component={Home}             />
    <Route path="/about"          exact={true} component={About}            />
    <Route path="/carrers"        exact={true} component={Carrers}          />
    <Route path="/contact"        exact={true} component={Contact}          />
    <Route path="/faq"            exact={true} component={FAQ}              />
    <Route path="/services"       exact={true} component={Services}         />
    <Route path="/bots/status"    exact={true} component={BotStatus}        />
    <Route path="/privacy"        exact={true} component={TermsOfPrivacy}   />
    <Route path="/terms"          exact={true} component={TermsOfUse}       />
    {/*<Route path='*' component={ComponenteDePagina404} />*/}
  </ BrowserRouter>
  , document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
